import {
    precompileTemplate
} from "@ember/template-compilation";
export default precompileTemplate("<div class=\"select-kit-header-wrapper\">\n  {{#if this.icons}}\n    <div class=\"future-date-input-selector-icons\">\n      {{#each this.icons as |icon|}} {{d-icon icon}} {{/each}}\n    </div>\n  {{/if}}\n\n  {{component this.selectKit.options.selectedNameComponent tabindex=this.tabindex item=this.selectedContent selectKit=this.selectKit}}\n\n  {{#if this.selectedContent.timeFormatted}}\n    <span class=\"future-date-input-selector-datetime\">\n      {{this.selectedContent.timeFormatted}}\n    </span>\n  {{/if}}\n\n  {{d-icon this.caretIcon class=\"caret-icon\"}}\n</div>", {
    moduleName: "select-kit/components/future-date-input-selector/future-date-input-selector-header.hbs"
});